import React from 'react';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import DynamicTable from './DynamicTable';
class AddressForm extends React.Component {
    constructor(props) {
        super(props);
      console.log(props);
      this.state = { checked: false };
      this.handleChange = this.handleChange.bind(this);
    }

    handleChange() {
        this.setState({
          checked: !this.state.checked
      })
      console.log(this.state.checked);

    }

    render() {
        const hidden = this.state.checked ? '' : 'hidden';
  return (
    <React.Fragment >

      <Typography variant="h6" gutterBottom>
        Personal details
      </Typography>
      <Grid container spacing={3}>
        <Grid item xs={12} sm={6} style={{color:"#000000 !important"}}>
          <TextField
            required
            id="Name"
            name="Name"
            label="Name"
            fullWidth
            baseColor = '#000000'
            autoComplete="given-name"
            style={{color:"#000000"}}
          />
        </Grid>
        <Grid item xs={12} sm={6}>
          <TextField
            required
            id="Email"
            name="Email"
            label="Email"
            fullWidth
            autoComplete="email"
          />
        </Grid>





        <Grid item xs={12}>
          <FormControlLabel
            control={<Checkbox style={{color:"#000000"}} name="saveAddress" value="yes" id="checks" checked={ this.state.checked } onChange={ this.handleChange }/>}
            label="Are there any other owners for the ship?"
          />

        </Grid >
        <Grid item xs={12} hidden={!this.state.checked}>

           <DynamicTable></DynamicTable> 

        </Grid>
      </Grid>

    </React.Fragment>
  );
}
}

export default AddressForm;
